package org.example.entity;import java.time.LocalDateTime;public class Locator {    private int id;    private String name;    private Boolean isActive;    private Integer x;    private Integer y;    private Integer z;    private LocalDateTime created;    private String createdBy;    private Warehouse warehouse;    public Locator(){}    public Locator(int id, String name, Boolean isActive, Integer x, Integer y, Integer z, LocalDateTime created,                   String createdBy, Warehouse warehouse) {        this.id = id;        this.name = name;        this.isActive = isActive;        this.x = x;        this.y = y;        this.z = z;        this.created = created;        this.createdBy = createdBy;        this.warehouse = warehouse;    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public Boolean getActive() {        return isActive;    }    public void setActive(Boolean active) {        isActive = active;    }    public Integer getX() {        return x;    }    public void setX(Integer x) {        this.x = x;    }    public Integer getY() {        return y;    }    public void setY(Integer y) {        this.y = y;    }    public Integer getZ() {        return z;    }    public void setZ(Integer z) {        this.z = z;    }    public LocalDateTime getCreated() {        return created;    }    public void setCreated(LocalDateTime created) {        this.created = created;    }    public String getCreatedBy() {        return createdBy;    }    public void setCreatedBy(String createdBy) {        this.createdBy = createdBy;    }    public Warehouse getWarehouse() {        return warehouse;    }    public void setWarehouse(Warehouse warehouse) {        this.warehouse = warehouse;    }}